                <CarouselItem>
                    <CarouselCaption>
                        <h3>Second slide label</h3>
                        <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
                    </CarouselCaption>
                </CarouselItem>
            </Carousel>
        </Container>
    );
}
export default About;
